var NAV=new Vue({el:"#prodNav",data:{nav:""},methods:{getJsonInfo:function(){this.$http.get("func.php?func=GetBillboardList").then(function(response){response.data=JSON.parse(response.data),this.nav=response.data.nav}).catch(function(response){console.log(response)})},goPage:function(index){var url=this.nav[index].c_bu_link_url,target=this.nav[index].c_bu_link_target;GEvent(this.nav[index].c_title),0===toNumber(target)&&(window.location.href=url),1===toNumber(target)&&window.open(url,"_blank")}},created:function(){this.getJsonInfo()},updated:function(){$("#bottom").click(function(){window.open("info.html","_blank")})}});